// CoinTable.js
import React from 'react';

const CoinTable = ({ cryptoList }) => {
  return (
    <div className="coin-table-container">
      <table className="coin-table">
        <thead>
          <tr>
            <th>Coin</th>
            <th>Price</th>
            <th>1h</th>
            <th>24h</th>
            <th>7d</th>
            <th>24h Volume</th>
            <th>Market Cap</th>
          </tr>
        </thead>
        <tbody>
          {cryptoList.map(crypto => (
            <tr key={crypto.id} onClick={() => window.location.href = `/${crypto.id}`}>
              <td>{crypto.name}</td>
              <td>${parseFloat(crypto.priceUsd).toFixed(2)}</td>
              <td>{crypto.changePercent1Hr ? `${parseFloat(crypto.changePercent1Hr).toFixed(2)}%` : 'N/A'}</td>
              <td>{crypto.changePercent24Hr ? `${parseFloat(crypto.changePercent24Hr).toFixed(2)}%` : 'N/A'}</td>
              <td>{crypto.changePercent7d ? `${parseFloat(crypto.changePercent7d).toFixed(2)}%` : 'N/A'}</td>
              <td>${parseFloat(crypto.volumeUsd24Hr).toFixed(2)}</td>
              <td>${parseFloat(crypto.marketCapUsd).toFixed(2)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default CoinTable;
